import React from "react";
import Navigation from "../components/Navigation";

const Home = () => {
  return (
    <div className="home">
      <Navigation />
      <div className="homeContent">
        <div className="content">
          <h1>Linus Torvalds</h1>
        </div>
      </div>
    </div>
  );
};

export default Home;
